import Card from '../commons/Card'

const Grid = ({popMovies}) => {
  return (
    <>
    <div className='d-flex margin'>
    {popMovies.map((movie)=>
      <Card movie={movie} key={movie.id}/>
      )}
      </div>
    </>
  )
}

export default Grid
